import React from "react";
import Feed from "./components/Feed";
import SideBar from "./components/SideBar";

function App() {
  return (
    <div className="min-h-screen bg-black ">
      <div className="flex flex max-w-[1500px] mx-auto">
        <SideBar />
        <Feed />
      </div>
    </div>
  );
}

export default App;
